import React from 'react'
import Todo from './Todo'

const TodoList = ({ todos }) => {
    return (
        <div>
            <ul>
                {todos.map((todo, index) => {
                    ;<Todo todo={todo} />
                })}
            </ul>
        </div>
    )
}

export default TodoList
